write a Python program to print out the first 100 prime numbers
Sure, here's an example code in Python that prints out the first 100 prime numbers:
```python
def is_prime(num):
    if num < 2:
        return False
    for i in range(2, int(num**0.5)+1):
        if num % i == 0:
            return False
    return True
primes = []
count = 0
for num in range(2, 101):
    if is_prime(num):
        primes.append(num)
        count += 1
if len(primes) < 100:
    primes.extend([i for i in range(len(primes), 101) if is_prime(i)]);
print("First 100 prime numbers:")
for num in primes[:100]:
    print(num)
```
This program defines a function `is_prime` that checks whether a given number is prime or not. It then creates an empty list `primes` and increments a counter variable `count`. The main loop starts at 2 and goes up to 100, checking each number for primality using the `is_prime` function. If the number is prime, it adds it to the `primes` list and increments the `count` variable.
If the length of the `primes` list is less than 100 after the loop finishes, it extends the list with the next 98 primes (i.e., numbers from 101 to 200). Finally, it prints out the first 100 prime numbers using a for-loop over the `primes` list.
